ranking0["Structural Ranking"];
cycle0 --&gt; ranking0;
ranking0 --&gt; input_structures; subgraph cycle["cycle"]; ranking1["Structural Ranking"]; judge{{"Fulfill requirements?"}}; export1["Export top N snapshots to next cycle"]; input_structures --&gt; trajectories --&gt; ranking1 --&gt; judge; judge -- No --&gt; export1 --&gt; input_structures;
end subgraph trajectories["Short MD simulations"]; direction TB; traj1(trj1); traj2(trj2); etc_trj(...); traj(trj N);
end subgraph input_structures[" "]; direction TB; rank1(rank1); rank2(rank2); etc_sim(...); rank(rank N);
end End((("finish")));
